  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for National
  Elk Refuge outlines Refuge accomplishments during the 1985 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses compliance with
  environmental and cultural resource mandates and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, volunteer
  programs, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, fire management, pest control, and water
  rights. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, migratory birds, raptors, game mammals, fisheries resources,
  marking and banding, and disease prevention and control. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  recreational uses, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, major maintenance,
  equipment utilization and replacement, communication systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end. Photographs
  and brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
